import './.categories.style.scss';

const App = () => {
  const categories = [
    {
      id: 1,
      title: 'Hats',
    },
    {
      id: 1,
      title: 'Jackets',
    },
    {
      id: 1,
      title: 'Sneakers',
    },
    {
      id: 1,
      title: 'Wemens',
    },
    {
      id: 1,
      title: 'Mens',
    },
  ];

  return (
    <div className="categories-con">
      {categories.map((category) => (
        <div key={category.id} className="category-con">
          <div className="bg-image" />
          <div className="category-body-con">
            <h2>{category.title}</h2>
            <p>Shop now</p>
          </div>
        </div>
      ))}

    </div>

  );
};

export default App;
